import React from "react";

const User = () => {
  return (
    <div>
      <form>
        <div>
          <label>Username</label>
          <input type="text"></input>
        </div>
        <div>
          <label>Age(Years)</label>
          <input type="text"></input>
        </div>
      </form>
    </div>
  );
};

export default User;
